/* eslint-disable @typescript-eslint/no-unused-vars */

/* eslint-disable @typescript-eslint/no-explicit-any */
const noop = () => {};

export class Deferred {
  constructor() {
    this.resolve = noop;
    this.reject = noop;
    this.promise = void 0;
    this.promise = new Promise((resolve, reject) => {
      this.resolve = resolve;
      this.reject = reject;
    });
  }

}
